function decrypt_decodeUtf8(encodedArray) {
    var decodedString = '';

    for (var i = 0; i < encodedArray.length; i++) {
        var currentByte = encodedArray[i];

        if (currentByte < 128) {
            decodedString += String.fromCharCode(currentByte);
        } else if (currentByte >= 192 && currentByte <= 223) {
            var nextByte = encodedArray[++i];
            decodedString += String.fromCharCode(((currentByte & 31) << 6) | (nextByte & 63));
        } else if (currentByte >= 224 && currentByte <= 239) {
            var nextByte1 = encodedArray[++i];
            var nextByte2 = encodedArray[++i];
            decodedString += String.fromCharCode(((currentByte & 15) << 12) | ((nextByte1 & 63) << 6) | (nextByte2 & 63));
        } else {
            // For simplicity, assuming all other cases are treated as single-byte characters
            decodedString += String.fromCharCode(currentByte);
        }
    }

    return decodedString;
}



