// x-s-common 加密
function x_s_common_encode(t) {
    // let t = {
    //     "s0": 5, // 设备标识,  5:other: web
    //     "s1": "",
    //     "x0": "1",
    //     "x1": "3.6.8",
    //     "x2": "Windows",
    //     "x3": "xhs-pc-web",
    //     "x4": "3.17.4",
    //     "x5": "18c05311d39uw9ovjxfw0cmq9q4vyccxp953k6e7i50000287204", // cookie中a1
    //     "x6": 1700896268046, // 时间戳
    //     // x7 : x-s
    //     "x7": "XYW_",
    //     "x8": "",
    //     // "x9": 1323981497,
    //     "x9": undefined,
    //     "x10": 100
    // }

    t.x9 = x9_sign(t)
    let t1 = JSON.stringify(t)
    let t2 = encrypt_encodeUtf8(t1)
    // console.log(t2)
    let t3 = encrypt_b64Encode(t2)
    // console.log(t3)
    return t3

}

// x-s-common 解密
function x_s_common_decode(t) {
    var encodedString = t;
    var decodedArray = decrypt_b64Decode(encodedString);
    var decodedString = decrypt_decodeUtf8(decodedArray);
    return decodedString
}



